import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";

import "swiper/css/effect-coverflow";
import "swiper/css/pagination";

import { EffectCoverflow, Pagination } from "swiper";

const Home = () => {
  return (
    <>
      <h1>bienvenue dans ce test</h1>
      <div className="SwiperStyle">
        <Swiper
          //loop={true}
          effect={"coverflow"}
          grabCursor={true}
          centeredSlides={true}
          slidesPerView={3}
          coverflowEffect={{
            rotate: 50,
            stretch: 0,
            depth: 100,
            modifier: 1,
            slideShadows: true,
          }}
          pagination={true}
          modules={[EffectCoverflow, Pagination]}
          className="mySwiper"
        >
          <SwiperSlide>
            <img src="/booksCover/atalarene.jpeg" alt="atala" />
          </SwiperSlide>
          <SwiperSlide>
            <img src="/booksCover/LaConfession.jpeg" alt="confession" />
          </SwiperSlide>

          <SwiperSlide>
            <img src="/booksCover/GuerreEtPaix.jpeg" alt="guerre" />
          </SwiperSlide>
          <SwiperSlide>
            <img src="/booksCover/crimeetchatiment.jpeg" alt="crime" />
          </SwiperSlide>

          <SwiperSlide>
            <img src="/booksCover/Atala.jpg" alt="atala" />
          </SwiperSlide>
          <SwiperSlide>
            <img src="/booksCover/LaConfession.jpeg" alt="confession" />
          </SwiperSlide>
        </Swiper>
      </div>
    </>
  );
};

export default Home;
